import pickle
import gzip
import matplotlib.pyplot as plt
import numpy as np

f = gzip.open('mnist.pkl.gz', 'rb')
(img_train, lab_train), (img_valid, lab_valid), (img_test, lab_test) = pickle.load(f, encoding='latin')
f.close()


def print_image(img):
    fig, axs = plt.subplots(2, 5, squeeze=True)
    for i in range(10):
        axs[int(i / 5), int(i % 5)].imshow(np.reshape(img[i], (28, 28)), cmap='gray')
        axs[int(i / 5), int(i % 5)].set_title(i)
        axs[int(i / 5), int(i % 5)].set_xticklabels([])
    plt.show()


def weight_init():
    return np.reshape(np.random.rand(7840, 1) - 0.5, (10, 784, 1))


def activation(sample, weight, bias):
    b = np.dot(sample, weight) + bias
    a = b > 0
    return a


def train_perceptron(data, labels, lr=0.5, iterations=2):
    weights = weight_init()
    bias = np.zeros(10)

    for iteration_counter in range(iterations):
        print(f"iterate {iteration_counter}")
        batch_iterator = 0
        batch_weights = np.reshape(np.zeros(7840), (10, 784, 1))
        batch_bias = np.zeros(10)

        for data_counter in range(len(data)):
            batch_iterator += 1
            for i in range(10):
                if labels[data_counter] == i:
                    good_label = 1
                else:
                    good_label = 0

                y = activation(data[data_counter], weights[i], bias[i])
                batch_weights[i] += np.reshape((good_label - y) * data[data_counter] * (lr / 10 ** iteration_counter),
                                               (784, 1))
                batch_bias[i] += (good_label - y) * (lr / 10 ** iteration_counter)

            if batch_iterator == 500:  # reached end of batch
                bias = np.add(bias, batch_bias)  # update main values
                weights = np.add(weights, batch_weights)
                batch_bias = np.zeros(10)  # reset batch values
                batch_weights = np.reshape(np.zeros(7840), (10, 784, 1))
                batch_iterator = 0

    return np.asarray(weights), np.asarray(bias)


def activation_vector(data, weights, bias):
    b = np.dot(data, weights)
    b = np.reshape(b, (len(data), 10))
    bias = np.reshape(bias, (1, 10))
    b += np.dot(np.reshape(np.zeros(len(data)) + 1, (len(data), 1)), bias)
    return b


def test(data, labels, weights, bias):
    vector = activation_vector(data, weights, bias)
    predicted = np.argmax(vector, axis=1)
    predicted = np.reshape(predicted, 10000)
    correct = (predicted == labels)
    accuracy = np.sum(correct) / len(correct)
    print(accuracy)


def test2(data, weights, bias):
    vector = activation_vector(data, weights, bias)
    predicted = np.argmax(vector, axis=1)
    print(predicted)


